import { React } from 'react';
import './UserForm.css'

const UserForm = () => {
    return (
        <div>
<form>
            <label> 
                Username
                <input type='text'/>
            </label>
            <label>
                Age (Years)
                <input type='text' />
            </label>
        </form>

        </div>
    );
}

export default UserForm;
